(function () {

	var device, 
		oscillators		= [],
		channels 		= 2,
		delay,
		reverb,
		delayTime 		= 0,
		delayFeedback	= 0,
		sustain			= 100,
		noteLength		= .4,
		semitone		= 1.05946,
		sampler,
		compressorLeft,
		compressorRight,
		bitCrusher,
		distortion;
	
	$(document).ready(function () {
		var laserRaw = '';

		device = audioLib.AudioDevice(audioCallback, channels);
		delay = audioLib.Delay(device.sampleRate, delayTime, delayFeedback);
		compressorLeft = audioLib.Compressor(device.sampleRate, 3, 0.5);
		compressorRight = audioLib.Compressor(device.sampleRate, 3, 0.5);
		reverb = audioLib.Reverb(device.sampleRate, channels);
		sampler = audioLib.Sampler(device.sampleRate);
		bitCrusher = audioLib.BitCrusher(device.sampleRate, 8);
		//distortion = audioLib.Distortion(device.sampleRate);
		
		//distortion.gain = 1.0;
				
		laserRaw = atob(laserRaw);
    	sampler.loadWav(laserRaw, true);

		loadUI();
	});
	
	function handleKeyDown(e) {
		if (e.which >= 48 && e.which <= 90) {			
			// based on a chromatic scale, centered on A440,
			// calculate a pitch centered on key code 69
			var hz = 440 * Math.pow(semitone, (69 - e.which));
			var attack = 10;
			var release = 10;
			
			var osc = audioLib.generators.Voice(
				device.sampleRate, 
				hz, 
				noteLength, 
				attack, 
				release, 
				sustain, 
				'sine');
				
			osc.key = e.which;
			oscillators.push(osc);
		}
	}
		
	function audioCallback(buffer, channelCount) {
		var sample = 0;
				
		var oscCount = oscillators.length, 
			oscMult = 0.8, 
			oscCurrent, 
			length = buffer.length, 
			n,
			sample,
			left,
			right;
			
		//remove completed voices
		for (n = oscCount - 1; n >= 0; n--) {
			if (oscillators[n].samplesLeft <= 0) {
				oscillators.splice(n,1);
			}
		}

		oscCount = oscillators.length;
		
		for (n = 0; n < length; n+=channelCount) {
			sample = left = right = 0;

			sampler.generate();
			sample += sample += sampler.getMix();

			// VOICES (a.k.a. notes)
			if (oscCount > 0) {
				for (oscCurrent = 0; oscCurrent < oscCount; oscCurrent++) {
					oscillators[oscCurrent].generate();
					sample += oscillators[oscCurrent].getMix() * oscMult;	
				}
			}
			
			// DISTORTION
			// sample += distortion.pushSample(sample);
			
			// BIT CRUSHER
			bitCrusher.pushSample(sample);
			sample = bitCrusher.getMix();
			
			// DELAY
			if (delay.time !== 0 && delay.feedback !== 0) {
				delay.pushSample(sample);
				sample = sample + delay.getMix();
			}
			
			// REVERB
			reverb.pushSample(sample, 0);
			reverb.pushSample(sample, 1);
			left = reverb.getMix(0);
			right = reverb.getMix(1);

			// COMPRESSOR
			left = compressorLeft.pushSample(left);			
			right = compressorRight.pushSample(right);			
			
			buffer[n] = left;
			buffer[n+1] = right;			
		}
							
	}
	
	function loadUI () {
		$(document).keydown(handleKeyDown);
		
		$('#noteLengthSlider').slider( {
			min: 10,
			max: 1000,
			step: 1,
			value: 100,
			change: function (event, ui) { updateNoteLength(ui.value); },
			slide: function (event, ui) { updateNoteLength(ui.value); }
		});

		$('#delayTimeSlider').slider( {
			min: 0,
			max: 1000,
			value: 0,
			change: function (event, ui) { updateDelayTime(ui.value); },
			slide: function (event, ui) { updateDelayTime(ui.value); }
		});

		$('#delayFeedbackSlider').slider( {
			min: 0,
			max: 1,
			step: .01,
			value: 0,
			change: function (event, ui) { updateDelayFeedback(ui.value); },
			slide: function (event, ui) { updateDelayFeedback(ui.value); }
		});

		$('#reverbDrySlider').slider( {
			min: 0,
			max: 1,
			step: .01,
			value: reverb.dry,
			change: function (event, ui) { reverb.dry = ui.value; },
			slide: function (event, ui) { reverb.dry = ui.value; }
		});
	
		$('#reverbWetSlider').slider( {
			min: 0,
			max: 1,
			step: .01,
			value: reverb.wet,
			change: function (event, ui) { reverb.wet = ui.value; },
			slide: function (event, ui) { reverb.wet = ui.value; }
		});

		$('#reverbSizeSlider').slider( {
			min: 0,
			max: 1,
			step: .01,
			value: reverb.roomSize,
			change: function (event, ui) { 
				reverb = audioLib.Reverb(device.sampleRate, channels, reverb.wet, reverb.dry, ui.value, reverb.damping);
			},
		});

		$('#reverbDampingSlider').slider( {
			min: 0,
			max: 1,
			step: .01,
			value: reverb.damping,
			change: function (event, ui) { 
				reverb = audioLib.Reverb(device.sampleRate, channels, reverb.wet, reverb.dry, reverb.roomSize, ui.value);
			}
		});
		
		$('#bitcrushSlider').slider( {
			min: 1,
			max: 8,
			step: 1,
			value: 8,
			change: function (event, ui) { 
				bitCrusher = audioLib.BitCrusher(device.sampleRate, ui.value);
			},
			slide: function (event, ui) { 
				bitCrusher = audioLib.BitCrusher(device.sampleRate, ui.value);
			}
		});
		

		$('#sampleButton').click( function () {
			sampler.noteOn(440);
		});
	}	
	
	function updateDelayTime (time) {
		delay.time = time;
	}
	
	function updateDelayFeedback (feedback) {
		delay.feedback = feedback;
	}
		
	function updateNoteLength (value) {
		sustain = value;
		noteLength = sustain / 500; // hack
	}

})();